父母是未成年子女的监护人。
未成年人的父母已经死亡或者没有监护能力的，由下列有监护能力的人按顺序担任监护人:
(一)祖父母、外祖父母;
(二)兄、姐;
(三)其他愿意担任监护人的个人或者组织，但是须经未成年人住所地的居民委员会、村民委员会或者民政部门同意。

无民事行为能力或者限制民事行为能力的成年人，由下列有监护能力的人按顺序担任监护人:
(一)配偶;
(二)父母、子女;
(三)其他近亲属;
(四)其他愿意担任监护人的个人或者组织，但是须经被监护人住所地的居民委员会、村民委员会或者民政部门同意。

监护人有下列情形之一的，人民法院根据有关个人或者组织的申请，撤销其监护人资格，安排必要的临时监护措施，并按照最有利于被监护人的原则依法指定监护人:
(一)实施严重损害被监护人身心健康的行为;
(二)怠于履行监护职责，或者无法履行监护职责且拒绝将监护职责部分或者全部委托给他人，导致被监护人处于危困状态;
(三)实施严重侵害被监护人合法权益的其他行为。
本条规定的有关个人、组织包括:其他依法具有监护资格的人，居民委员会、村民委员会、学校、医疗机构、妇女联合会、残疾人联合会、未成年人保护组织、依法设立的老年人组织、民政部门等。
前款规定的个人和民政部门以外的组织未及时向人民法院申请撤销监护人资格的，民政部门应当向人民法院申请。

有下列情形之一的，监护关系终止:
(一)被监护人取得或者恢复完全民事行为能力;
(二)监护人丧失监护能力;
(三)被监护人或者监护人死亡;
(四)人民法院认定监护关系终止的其他情形。
监护关系终止后，被监护人仍然需要监护的，应当依法另行确定监护人。

有下列原因之一并依法完成清算、注销登记的，法人终止:
(一)法人解散;
(二)法人被宣告破产;
(三)法律规定的其他原因。
法人终止，法律、行政法规规定须经有关机关批准的，依照其规定。

有下列情形之一的，法人解散:
(一)法人章程规定的存续期间届满或者法人章程规定的其他解散事由出现;
(二)法人的权力机构决议解散;
(三)因法人合并或者分立需要解散;
(四)法人依法被吊销营业执照、登记证书，被责令关闭或者被撤销;
(五)法律规定的其他情形。

有下列情形之一的，非法人组织解散:
(一)章程规定的存续期间届满或者章程规定的其他解散事由出现;
(二)出资人或者设立人决定解散;
(三)法律规定的其他情形。

民事主体依法享有知识产权。
知识产权是权利人依法就下列客体享有的专有的权利:
(一)作品;
(二)发明、实用新型、外观设计;
(三)商标;
(四)地理标志;
(五)商业秘密;
(六)集成电路布图设计;
(七)植物新品种;
(八)法律规定的其他客体。

具备下列条件的民事法律行为有效:
(一)行为人具有相应的民事行为能力;
(二)意思表示真实;
(三)不违反法律、行政法规的强制性规定，不违背公序良俗。

有下列情形之一的，撤销权消灭:
(一)当事人自知道或者应当知道撤销事由之日起一年内、重大误解的当事人自知道或者应当知道撤销事由之日起九十日内没有行使撤销权;
(二)当事人受胁迫，自胁迫行为终止之日起一年内没有行使撤销权;
(三)当事人知道撤销事由后明确表示或者以自己的行为表明放弃撤销权。
当事人自民事法律行为发生之日起五年内没有行使撤销权的，撤销权消灭。

有下列情形之一的，委托代理终止:
(一)代理期限届满或者代理事务完成;
(二)被代理人取消委托或者代理人辞去委托;
(三)代理人丧失民事行为能力;
(四)代理人或者被代理人死亡;
(五)作为代理人或者被代理人的法人、非法人组织终止。

被代理人死亡后，有下列情形之一的，委托代理人实施的代理行为有效:
(一)代理人不知道且不应当知道被代理人死亡;
(二)被代理人的继承人予以承认;
(三)授权中明确代理权在代理事务完成时终止;
(四)被代理人死亡前已经实施，为了被代理人的继承人的利益继续代理。
作为被代理人的法人、非法人组织终止的，参照适用前款规定。

有下列情形之一的，法定代理终止:
(一)被代理人取得或者恢复完全民事行为能力;
(二)代理人丧失民事行为能力;
(三)代理人或者被代理人死亡;
(四)法律规定的其他情形。

承担民事责任的方式主要有:
(一)停止侵害;
(二)排除妨碍;
(三)消除危险;
(四)返还财产;
(五)恢复原状;
(六)修理、重作、更换;
(七)继续履行;
(八)赔偿损失;
(九)支付违约金;
(十)消除影响、恢复名誉;
(十一)赔礼道歉。
法律规定惩罚性赔偿的，依照其规定。
本条规定的承担民事责任的方式，可以单独适用，也可以合并适用。

在诉讼时效期间的最后六个月内，因下列障碍，不能行使请求权的，诉讼时效中止:
(一)不可抗力;
(二)无民事行为能力人或者限制民事行为能力人没有法定代理人，或者法定代理人死亡、丧失民事行为能力、丧失代理权;
(三)继承开始后未确定继承人或者遗产管理人;
(四)权利人被义务人或者其他人控制;
(五)其他导致权利人不能行使请求权的障碍。
自中止时效的原因消除之日起满六个月，诉讼时效期间届满。

有下列情形之一的，诉讼时效中断，从中断、有关程序终结时起，诉讼时效期间重新计算:
(一)权利人向义务人提出履行请求;
(二)义务人同意履行义务;
(三)权利人提起诉讼或者申请仲裁;
(四)与提起诉讼或者申请仲裁具有同等效力的其他情形。

下列请求权不适用诉讼时效的规定:
(一)请求停止侵害、排除妨碍、消除危险;
(二)不动产物权和登记的动产物权的权利人请求返还财产;
(三)请求支付抚养费、赡养费或者扶养费;
(四)依法不适用诉讼时效的其他请求权。

登记机构应当履行下列职责:
(一)查验申请人提供的权属证明和其他必要材料;
(二)就有关登记事项询问申请人;
(三)如实、及时登记有关事项;
(四)法律、行政法规规定的其他职责。
申请登记的不动产的有关情况需要进一步证明的，登记机构可以要求申请人补充材料，必要时可以实地查看。

登记机构不得有下列行为:
(一)要求对不动产进行评估;
(二)以年检等名义进行重复登记;
(三)超出登记职责范围的其他行为。

集体所有的不动产和动产包括:
(一)法律规定属于集体所有的土地和森林、山岭、草原、荒地、滩涂;
(二)集体所有的建筑物、生产设施、农田水利设施;
(三)集体所有的教育、科学、文化、卫生、体育等设施;
(四)集体所有的其他不动产和动产。

农民集体所有的不动产和动产，属于本集体成员集体所有。
下列事项应当依照法定程序经本集体成员决定:
(一)土地承包方案以及将土地发包给本集体以外的组织或者个人承包;
(二)个别土地承包经营权人之间承包地的调整;
(三)土地补偿费等费用的使用、分配办法;
(四)集体出资的企业的所有权变动等事项;
(五)法律规定的其他事项。

对于集体所有的土地和森林、山岭、草原、荒地、滩涂等，依照下列规定行使所有权:
(一)属于村农民集体所有的，由村集体经济组织或者村民委员会依法代表集体行使所有权;
(二)分别属于村内两个以上农民集体所有的，由村内各该集体经济组织或者村民小组依法代表集体行使所有权;
(三)属于乡镇农民集体所有的，由乡镇集体经济组织代表集体行使所有权。

下列事项由业主共同决定:
(一)制定和修改业主大会议事规则;
(二)制定和修改管理规约;
(三)选举业主委员会或者更换业主委员会成员;
(四)选聘和解聘物业服务企业或者其他管理人;
(五)使用建筑物及其附属设施的维修资金;
(六)筹集建筑物及其附属设施的维修资金;
(七)改建、重建建筑物及其附属设施;
(八)改变共有部分的用途或者利用共有部分从事经营活动;
(九)有关共有和共同管理权利的其他重大事项。
业主共同决定事项，应当由专有部分面积占比三分之二以上的业主且人数占比三分之二以上的业主参与表决。决定前款

无处分权人将不动产或者动产转让给受让人的，所有权人有权追回;除法律另有规定外，符合下列情形的，受让人取得该不动产或者动产的所有权:
(一)受让人受让该不动产或者动产时是善意;
(二)以合理的价格转让;
(三)转让的不动产或者动产依照法律规定应当登记的已经登记，不需要登记的已经交付给受让人。
受让人依据前款规定取得不动产或者动产的所有权的，原所有权人有权向无处分权人请求损害赔偿。
当事人善意取得其他物权的，参照适用前两款规定。

通过招标、拍卖、协议等出让方式设立建设用地使用权的，当事人应当采用书面形式订立建设用地使用权出让合同。
建设用地使用权出让合同一般包括下列条款:
(一)当事人的名称和住所;
(二)土地界址、面积等;
(三)建筑物、构筑物及其附属设施占用的空间;
(四)土地用途、规划条件;
(五)建设用地使用权期限;
(六)出让金等费用及其支付方式;
(七)解决争议的方法。

设立居住权，当事人应当采用书面形式订立居住权合同。
居住权合同一般包括下列条款:
(一)当事人的姓名或者名称和住所;
(二)住宅的位置;
(三)居住的条件和要求;
(四)居住权期限;
(五)解决争议的方法。

设立地役权，当事人应当采用书面形式订立地役权合同。
地役权合同一般包括下列条款:
(一)当事人的姓名或者名称和住所;
(二)供役地和需役地的位置;
(三)利用目的和方法;
(四)地役权期限;
(五)费用及其支付方式;
(六)解决争议的方法。

地役权人有下列情形之一的，供役地权利人有权解除地役权合同，地役权消灭:
(一)违反法律规定或者合同约定，滥用地役权;
(二)有偿利用供役地，约定的付款期限届满后在合理期限内经两次催告未支付费用。

有下列情形之一的，担保物权消灭:
(一)主债权消灭;
(二)担保物权实现;
(三)债权人放弃担保物权;
(四)法律规定担保物权消灭的其他情形。

规定设定抵押的，抵押财产自下列情形之一发生时确定:
(一)债务履行期限届满，债权未实现;
(二)抵押人被宣告破产或者解散;
(三)当事人约定的实现抵押权的情形;
(四)严重影响债权实现的其他情形。

下列财产不得抵押:
(一)土地所有权;
(二)宅基地、自留地、自留山等集体所有土地的使用权，但是法律规定可以抵押的除外;
(三)学校、幼儿园、医疗机构等为公益目的成立的非营利法人的教育设施、医疗卫生设施和其他公益设施;
(四)所有权、使用权不明或者有争议的财产;
(五)依法被查封、扣押、监管的财产;
(六)法律、行政法规规定不得抵押的其他财产。

设立抵押权，当事人应当采用书面形式订立抵押合同。
抵押合同一般包括下列条款:
(一)被担保债权的种类和数额;
(二)债务人履行债务的期限;
(三)抵押财产的名称、数量等情况;
(四)担保的范围。

同一财产向两个以上债权人抵押的，拍卖、变卖抵押财产所得的价款依照下列规定清偿:
(一)抵押权已经登记的，按照登记的时间先后确定清偿顺序;
(二)抵押权已经登记的先于未登记的受偿;
(三)抵押权未登记的，按照债权比例清偿。
其他可以登记的担保物权，清偿顺序参照适用前款规定。

有下列情形之一的，抵押权人的债权确定:
(一)约定的债权确定期间届满;
(二)没有约定债权确定期间或者约定不明确，抵押权人或者抵押人自最高额抵押权设立之日起满二年后请求确定债权;
(三)新的债权不可能发生;
(四)抵押权人知道或者应当知道抵押财产被查封、扣押;
(五)债务人、抵押人被宣告破产或者解散;
(六)法律规定债权确定的其他情形。

设立质权，当事人应当采用书面形式订立质押合同。
质押合同一般包括下列条款:
(一)被担保债权的种类和数额;
(二)债务人履行债务的期限;
(三)质押财产的名称、数量等情况;
(四)担保的范围;
(五)质押财产交付的时间、方式。

合同的内容由当事人约定，一般包括下列条款:
(一)当事人的姓名或者名称和住所;
(二)标的;
(三)数量;
(四)质量;
(五)价款或者报酬;
(六)履行期限、地点和方式;
(七)违约责任;
(八)解决争议的方法。
当事人可以参照各类合同的示范文本订立合同。

要约是希望与他人订立合同的意思表示，该意思表示应当符合下列条件:
(一)内容具体确定;
(二)表明经受要约人承诺，要约人即受该意思表示约束。

要约可以撤销，但是有下列情形之一的除外:
(一)要约人以确定承诺期限或者其他形式明示要约不可撤销;
(二)受要约人有理由认为要约是不可撤销的，并已经为履行合同做了合理准备工作。

有下列情形之一的，要约失效:
(一)要约被拒绝;
(二)要约被依法撤销;
(三)承诺期限届满，受要约人未作出承诺;
(四)受要约人对要约的内容作出实质性变更。

合同中的下列免责条款无效:
(一)造成对方人身损害的;
(二)因故意或者重大过失造成对方财产损失的。

当事人在订立合同过程中有下列情形之一，造成对方损失的，应当承担赔偿责任:
(一)假借订立合同，恶意进行磋商;
(二)故意隐瞒与订立合同有关的重要事实或者提供虚假情况;
(三)有其他违背诚信原则的行为。

应当先履行债务的当事人，有确切证据证明对方有下列情形之一的，可以中止履行:
(一)经营状况严重恶化;
(二)转移财产、抽逃资金，以逃避债务;
(三)丧失商业信誉;
(四)有丧失或者可能丧失履行债务能力的其他情形。
当事人没有确切证据中止履行的，应当承担违约责任。

有下列情形之一的，债务人可以向受让人主张抵销:
(一)债务人接到债权转让通知时，债务人对让与人享有债权，且债务人的债权先于转让的债权到期或者同时到期;
(二)债务人的债权与转让的债权是基于同一合同产生。

有下列情形之一的，债权债务终止:
(一)债务已经履行;
(二)债务相互抵销;
(三)债务人依法将标的物提存;
(四)债权人免除债务;
(五)债权债务同归于一人;
(六)法律规定或者当事人约定终止的其他情形。
合同解除的，该合同的权利义务关系终止。

债务人在履行主债务外还应当支付利息和实现债权的有关费用，其给付不足以清偿全部债务的，除当事人另有约定外，应当按照下列顺序履行:
(一)实现债权的有关费用;
(二)利息;
(三)主债务。

有下列情形之一的，当事人可以解除合同:
(一)因不可抗力致使不能实现合同目的;
(二)在履行期限届满前，当事人一方明确表示或者以自己的行为表明不履行主要债务;
(三)当事人一方迟延履行主要债务，经催告后在合理期限内仍未履行;
(四)当事人一方迟延履行债务或者有其他违约行为致使不能实现合同目的;
(五)法律规定的其他情形。
以持续履行的债务为内容的不定期合同，当事人可以随时解除合同，但是应当在合理期限之前通知对方。

有下列情形之一，难以履行债务的，债务人可以将标的物提存:
(一)债权人无正当理由拒绝受领;
(二)债权人下落不明;
(三)债权人死亡未确定继承人、遗产管理人，或者丧失民事行为能力未确定监护人;
(四)法律规定的其他情形。
标的物不适于提存或者提存费用过高的，债务人依法可以拍卖或者变卖标的物，提存所得的价款。

当事人一方不履行非金钱债务或者履行非金钱债务不符合约定的，对方可以请求履行，但是有下列情形之一的除外:
(一)法律上或者事实上不能履行;
(二)债务的标的不适于强制履行或者履行费用过高;
(三)债权人在合理期限内未请求履行。
有前款规定的除外情形之一，致使不能实现合同目的的，人民法院或者仲裁机构可以根据当事人的请求终止合同权利义务关系，但是不影响违约责任的承担。

当事人约定出卖人保留合同标的物的所有权，在标的物所有权转移前，买受人有下列情形之一，造成出卖人损害的，除当事人另有约定外，出卖人有权取回标的物:
(一)未按照约定支付价款，经催告后在合理期限内仍未支付;
(二)未按照约定完成特定条件;
(三)将标的物出卖、出质或者作出其他不当处分。
出卖人可以与买受人协商取回标的物;协商不成的，可以参照适用担保物权的实现程序。

受赠人有下列情形之一的，赠与人可以撤销赠与:
(一)严重侵害赠与人或者赠与人近亲属的合法权益;
(二)对赠与人有扶养义务而不履行;
(三)不履行赠与合同约定的义务。
赠与人的撤销权，自知道或者应当知道撤销事由之日起一年内行使。

当事人在保证合同中约定，债务人不能履行债务时，由保证人承担保证责任的，为一般保证。
一般保证的保证人在主合同纠纷未经审判或者仲裁，并就债务人财产依法强制执行仍不能履行债务前，有权拒绝向债权人承担保证责任，但是有下列情形之一的除外:
(一)债务人下落不明，且无财产可供执行;
(二)人民法院已经受理债务人破产案件;
(三)债权人有证据证明债务人的财产不足以履行全部债务或者丧失履行债务能力;
(四)保证人书面表示放弃本款规定的权利。

有下列情形之一，非因承租人原因致使租赁物无法使用的，承租人可以解除合同:
(一)租赁物被司法机关或者行政机关依法查封、扣押;
(二)租赁物权属有争议;
(三)租赁物具有违反法律、行政法规关于使用条件的强制性规定情形。

出租人应当保证承租人对租赁物的占有和使用。
出租人有下列情形之一的，承租人有权请求其赔偿损失:
(一)无正当理由收回租赁物;
(二)无正当理由妨碍、干扰承租人对租赁物的占有和使用;
(三)因出租人的原因致使

有下列情形之一的，出租人或者承租人可以解除融资租赁合同:
(一)出租人与出卖人订立的买卖合同解除、被确认无效或者被撤销，且未能重新订立买卖合同;
(二)租赁物因不可归责于当事人的原因毁损、灭失，且不能修复或者确定替代物;
(三)因出卖人的原因致使融资租赁合同的目的不能实现。

保管人应当在仓单上签名或者盖章。仓单包括下列事项:
(一)存货人的姓名或者名称和住所;
(二)仓储物的品种、数量、质量、包装及其件数和标记;
(三)仓储物的损耗标准;
(四)储存场所;
(五)储存期限;
(六)仓储费;
(七)仓储物已经办理保险的，其保险金额、期间以及保险人的名称;
(八)填发人、填发地和填发日期。

得利人没有法律根据取得不当利益的，受损失的人可以请求得利人返还取得的利益，但是有下列情形之一的除外:
(一)为履行道德义务进行的给付;
(二)债务到期之前的清偿;
(三)明知无给付义务而进行的债务清偿。
